description:
Замовляйте Таксі 838 онлайн швидко і легко всього в 3 кліка! Миттєва подача і ніяких дзвінків. Вам потрібно всього лише відкрити мобільний додаток, вказати адресу і натиснути на кнопку "Замовити" і спостерігати за пошуком і пересуванням авто. Забудьте назавжди про дзвінки в різні служби таксі!

Замовлення таксі онлайн доступне в Києві, Одесі, Харкові, Львові, Полтаві, Дніпрі, Запоріжжі, Маріуполі та Вінниці.

Зручний інтерфейс і широкий функціонал додатка зробить процес замовлення таксі зручним і зрозумілим навіть для новачка.
Плюси нашого мобільного додатка:
- швидкий виклик авто;
- пошук і підбір авто по зазначеним вимогам;
- доступні тарифи;
- миттєвий та точний розрахунок вартості;
- можливість попереднього замовлення;
- якість роботи;
- підтримка 24/7.

Крім цього, в нашому додатку Ви можете самостійно вибирати тариф, повідомити про необхідність додаткових послуг. При виборі авто, Ви відразу можете ознайомитися з інформацією про водія, побачити його рейтинг і коментарі користувачів. Після завершення замовлення можна залишити відгук і оцінити поїздку.
Скачайте додаток Таксі 838 на свій пристрій і вирушайте в дорогу вже зараз.

INFOBUS is an application to search and purchase bus, train and plane tickets.

You can use INFOBUS for the following:
- book and buy tickets in just a few clicks without leaving home;
- check flight schedules online;
- always have tickets with you;
- automatically receive bonuses upon payment of a ticket.

Key Features:

Convenience - user-friendly interface;
Time saving – the application saves your time, so you could spend it on yourself :)
Efficiency – the ticket is immediately sent to your email upon payment;
Simplicity – easy-to-use search, booking and payment system;
Information content - the application contains up-to-date information on seats availability on flights, luggage transportation features, current prices and discounts, etc.;
Systematic updates – the application is constantly updated and supplemented with new information and features for the convenience of our customers.


We created this application to make your life easier.

INFOBUS
Choose the best

Opti is a taxi booking app.

Opti will allow you to find a car quickly, as we are looking for a driver close to you.

Our taxi service is available in 32 cities of Ukraine, Poland and Lithuania.

Opti has the following advantages in the taxi market:
you can order a taxi just in a few clicks;
pay with cash or card;
bonus system – you can get a free ride;
referral system – bring your friends and receive bonuses;
choose additional services: air conditioning, pet transportation, and other;
blacklist taxi drivers for inappropriate behavior;
rate the driver and leave a comment after the trip, we appreciate your opinion.

Opti operates in Poland, Lithuania and Ukraine, namely in Kyiv, Lviv, Dnipro, Odesa, Zaporizhzhya, Chernivtsi, Rivne, Ivano-Frankivsk, Kryvyi Rih, Zhytomyr, Kharkiv, Vinnytsia, Lutsk, Kamianske, Mykolaiv, Kherson, Khmelnytskyi, Ternopil, Sumy, Warsaw (Poland), Gdansk (Poland), Gdynia (Poland), Sopot (Poland), Wroclaw (Poland), Poznan (Poland), Vilnius (Lithuania), Jonava (Lithuania) and Kaunas (Lithuania).

If you have any suggestions or find a bug, please contact us: ios@optima.fm

Compatibility: iOS 13.5.1 or later.
The app can run on iPhone 6S, iPhone 7, iPhone 8, iPhone X, iPhone XS, iPhone XS Max, iPhone 11, iPhone 11 Pro, iPhone 11 Pro Max, iPhone SE.
Languages: Russian, Ukrainian, English, Polish.
